import React from 'react'
import { StyleSheet, View, Text, TouchableOpacity } from 'react-native'
import { Button } from 'react-native-elements'
import Icon from 'react-native-vector-icons/FontAwesome'

export default function Homescreen({ navigation }) {


    const goContact = () => {
       //  navigation.navigate('Contact');
        navigation.push('order');
    }

    const goProducts = () =>{
        navigation.navigate('Products')
    }

    const goCategory = () =>{
        navigation.navigate('Category')
    }

    return (
    <View style={styles.container} >
        <View style={styles.header}>
        <Text style={styles.title}>  Home Screen!</Text>
        </View>
        <View style={styles.footer}>
        <View>
          <TouchableOpacity onPress={() => goContact()}>
            <View style={styles.viewBtn}>
              <Text style={styles.textStyle}>Go to Order!</Text>
            </View>
              </TouchableOpacity>
        </View>
          <View>
          <TouchableOpacity onPress={() => goProducts()}>
            <View style={styles.viewBtn}>
              <Text style={styles.textStyle}>Go to Products!</Text>
            </View>
              </TouchableOpacity>
        </View>
          <View >
          <TouchableOpacity onPress={() => goCategory()}>
            <View style={styles.viewBtn}>
              <Text style={styles.textStyle}>Go to Categories!</Text>
            </View>
              </TouchableOpacity>
        </View>
        </View>





        </View>

    )
}

const styles = StyleSheet.create({
    container: {
       flex: 1,
      justifyContent: 'center',
      backgroundColor: '#ecf0f1',
      alignItems: 'center',
      backgroundColor: '#14213d',
      marginTop:20,

    },
    viewBtn: {
      backgroundColor: "#14213d",
      borderRadius: 15,
      width: 259,
      height: 61,
      textAlign: 'center',
      padding:20,
      marginTop:30,
       border: 'double',
       borderColor:'#fca311',
       borderWidth:2,
    },
     textStyle: {
          color:"#e5e5e5",
          fontSize: 16,
          fontWeight: 'bold'
      },
        title: {
        color: '#e5e5e5',
        fontSize: 30,
        fontWeight: 'bold'
    },
    header: {
          flex: 1,
          backgroundColor: '#14213d',
          justifyContent: 'flex-end',
          paddingHorizontal: 30,
          paddingBottom: 50
      },
      footer: {
          flex: 3,
          backgroundColor: '#e5e5e5',
          borderTopLeftRadius: 50,
          borderTopRightRadius: 50,
          paddingHorizontal: 85,
          paddingVertical: 30
      },
    });
